import classNames from 'classnames/bind';
import styles from './Login.module.scss';

const cx = classNames.bind(styles);

function Login() {
    return (
        <div class={cx('wrapper fadeInDown')}>
            <div id="formContent">
                <div class={cx('fadeIn first')}>
                    <img
                        src="data:image/jpeg;base64,"
                        id="icon"
                        alt="User Icon"
                    />
                </div>

                <form>
                    <input type="text" id="login" class={cx('fadeIn second')} name="login" placeholder="login" />
                    <input type="text" id="password" class={cx('fadeIn third')} name="login" placeholder="password" />
                    <input type="submit" class={cx('fadeIn fourth')} value="Log In" />
                </form>

                <div id="formFooter">
                    <a class={cx('underlineHover')} href="#">
                        Forgot Password?
                    </a>
                </div>
            </div>
        </div>
    );
}

export default Login;
